    public static List<List<Integer>> to2DList(int[][] arr) {
        List<List<Integer>> wrappedList = new ArrayList<>();

        for (int i = 0; i < arr.length; i++) {
            List<Integer> list = new ArrayList<>();
            for (int j = 0; j < arr[i].length; j++)
                list.add(arr[i][j]);
            wrappedList.add(list);
        }

        return wrappedList;
    }
